description:
This is Stanley Kubrick - A Life in Pictures, a very good documentary on Stanley Kubrick and all of his films.

The career and life of Stanley Kubrick
is explored through pictures, clips from
his films, his old home movies, comments
from his colleagues and a narration
by Tom Cruise.
